// About.js
import React from 'react';
import Header from '../../components/header/Header';
import Footer from '../../components/footer/Footer';
import Background from '../../components/background/Background';
import './About.scss';

const About = () => {
  return (
    <Background
    leftBackgroundImage="../../../src/images/about/backgroundLeft.png"
    rightBackgroundImage="../../../src/images/about/backgroundRight.png"
    mainBackgroundImage="../../../src/images/about/background.png"
    >
      <Header />
      <h1>About</h1>
      <div className='leftContentAbout'>
        <div className='leftContentIconAbout'>
          <i class="fa-solid fa-house"></i>
          <i class="fa-solid fa-bug-slash"></i>
          <i class="fa-solid fa-fire-flame-curved"></i>
          <i class="fa-solid fa-bug-slash"></i>
          <i class="fa-solid fa-fire-flame-curved"></i>
        </div>
        <div className='button-playAbout'>
          <i class="fa-solid fa-circle-play"></i>
        </div>
      </div>
      <Footer />
    </Background>
  );
};

export default About;
